import React from 'react';
import BaseLayout from '../components/layouts/BaseLayout';
import axios from 'axios';
import Link from 'next/link';


class Cv extends React.Component{

	render() {
		// debugger
		const titleval = "hiii"
		this.state = { para: "hello", h1: "some"}
		var { para } = this.state;
		const { h1 } = this.state;
		this.state = {a: 'Apple', b: 'Banana', c: 'Orange'}
	    const { fruit } = this.state;
		return(
	  	 <BaseLayout>
		  	<h1>New CV Page</h1>

		  	<h2>{fruit}</h2>

		  	<div>
		  		<p>{ titleval }</p>
		  		<h1>{ para }</h1>
		  		<h1>{ h1 }</h1>
		  	</div>
	  	</BaseLayout>
	  	)
	}
}
export default Cv;
